import "./App.css";
import Home from "./Home.js";
import Add from "./Add.js";
import { Route, Routes } from "react-router-dom";
import "./app.css";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home className="home" />} />
      <Route path="/add" styles={{ font: "40px" }} element={<Add />} />
    </Routes>
  );
}

export default App;
